<script>
export default {
  data() {
    return {
      //Height
      heightLow: false,
      heightMed: false,
      heightHigh: false,
      //Weight
      weightLow: false,
      weightMed: false,
      weightHigh: false
    }
  },
  methods: {
    onClick(value) {
      if (value === 'heightLow') {
        this.heightLow = !this.heightLow
        this.$emit('recieve', 'heightLow')
      } else if (value === 'heightMed') {
        this.heightMed = !this.heightMed
        this.$emit('recieve', 'heightMed')
      } else if (value === 'heightHigh') {
        this.heightHigh = !this.heightHigh
        this.$emit('recieve', 'heightHigh')
      } else if (value === 'weightLow') {
        this.weightLow = !this.weightLow
        this.$emit('recieve', 'weightLow')
      } else if (value === 'weightMed') {
        this.weightMed = !this.weightMed
        this.$emit('recieve', 'weightMed')
      } else if (value === 'weightHigh') {
        this.weightHigh = !this.weightHigh
        this.$emit('recieve', 'weightHigh')
      }
    }
  }
}
</script>

